import {Grid, Card }from '@material-ui/core';

export default function Home() {
    return (
        <div>
            <Grid container>
                <Grid item xs={12} sm={3}>
                    <Card>
                        <h1> flemin</h1>
                    </Card>
                </Grid>
                <Grid item xs={12} sm={9}>
                    <Card>
                        <h1> flemin</h1>
                    </Card>
                </Grid>
            </Grid>
        </div>
    )
}
